aling in neuronal<br>cells. Enhances the ability of PTEN to suppress AKT1 activation. Plays a role in nerve<br>growth factor (NGF)-induced recruitment of RAPGEF2 to late endosomes and neurite outgrowth;<br>Membrane associated guanylate kinases","Voltage-dependent calcium channel subunit alpha-2/delta-1; The alpha-2/delta subunit of<br>voltage-dependent calcium channels regulates calcium current density and<br>activation/inactivation kinetics of the calcium channel. Plays an important role in<br>excitation-contraction coupling (By similarity)","Serine/threonine-protein kinase NLK; Serine/threonine-protein kinase that regulates a number<br>of transcription factors with key roles in cell fate determination. Positive effector of the<br>non-canonical Wnt signaling pathway, acting downstream of WNT5A, MAP3K7/TAK1 and HIPK2.<br>Activation of this pathway causes binding to and phosphorylation of the histone<br>methyltransferase SETDB1. The NLK- SETDB1 complex subsequently interacts with PPARG, leading<br>to methylation of PPARG target promoters at histone H3K9 and transcriptional silencing. The<br>resulting loss of PPARG target gene transcription inh [...]","Protein piccolo; May act as a scaffolding protein involved in the organization of synaptic<br>active zones and in synaptic vesicle trafficking; C2 domain containing","Semaphorin-3E; Plays an important role in signaling via the cell surface receptor PLXND1.<br>Mediates reorganization of the actin cytoskeleton, leading to the retraction of cell<br>projections. Promotes focal adhesion disassembly and inhibits adhesion of endothelial cells<br>to the extracellular matrix. Regulates angiogenesis, both during embryogenesis and after<br>birth. Can down- regulate sprouting angiogenesis. Required for normal vascular patterning<br>during embryogenesis. Plays an important role in ensuring the specificity of synapse<br>formation (By similarity); Immunoglobulin like domain containing","E3 ubiquitin-protein ligase TRIM22; Interferon-induced antiviral protein involved in cell<br>innate immunity. The antiviral activity could in part be mediated by TRIM22-dependent<br>ubiquitination of viral proteins. Plays a role in restricting the replication of HIV-1,<br>encephalomyocarditis virus (EMCV) and hepatitis B virus (HBV). Acts as a transcriptional<br>repressor of HBV core promoter. May have E3 ubiquitin-protein ligase activity; Minor<br>histocompatibility antigens","Multiple C2 and transmembrane domain-containing protein 2; Might play a role in the<br>development of cardiac outflow tract; Multiple C2 and transmembrane domain containing","Beta-1,3-galactosyltransferase 2; Beta-1,3-galactosyltransferase that transfers galactose<br>from UDP-galactose to substrates with a terminal beta-N- acetylglucosamine (beta-GlcNAc)<br>residue. Can also utilize substrates with a terminal galactose residue, albeit with lower<br>efficiency. Involved in the biosynthesis of the carbohydrate moieties of glycolipids and<br>glycoproteins. Inactive towards substrates with terminal alpha-N-acetylglucosamine<br>(alpha-GlcNAc) or alpha-N-acetylgalactosamine (alpha-GalNAc) residues","Metabotropic glutamate receptor 3; G-protein coupled receptor for glutamate. Ligand binding<br>causes a conformation change that triggers signaling via guanine nucleotide-binding proteins<br>(G proteins) and modulates the activity of down-stream effectors. Signaling inhibits<br>adenylate cyclase activity; Glutamate metabotropic receptors","Embigin; Plays a role in the outgrowth of motoneurons and in the formation of neuromuscular<br>junctions. Following muscle denervation, promotes nerve terminal sprouting and the formation<br>of additional acetylcholine receptor clusters at synaptic sites without affecting terminal<br>Schwann cell number or morphology. Delays the retraction of terminal sprouts following<br>re-innervation of denervated endplates. May play a role in targeting the monocarboxylate<br>transporters SLC16A1 and SLC16A7 to the cell membrane ptic density and may funct [...]","Transcription initiation factor TFIID subunit 6; TAFs are components of the transcription<br>factor IID (TFIID) complex, PCAF histone acetylase complex and TBP-free TAFII complex<br>(TFTC). TIIFD is multimeric protein complex that plays a central role in mediating promoter<br>responses to various activators and repressors; Belongs to the TAF6 family","Protein HID1; May play an important role in the development of cancers in a broad range of<br>tissues","Probable E3 ubiquitin-protein ligase DTX3; Regulator of Notch signaling, a signaling pathway<br>involved in cell-cell communications that regulates a broad spectrum of cell-fate<br>determinations. Probably acts both as a positive and negative regulator of Notch, depending<br>on the developmental and cell context (By similarity). Functions as an ubiquitin ligase<br>protein in vitro, suggesting that it may regulate the Notch pathway via some ubiquitin<br>ligase activity; Ring finger proteins","Ragulator complex protein LAMTOR4; As part of the Ragulator complex it is involved in amino<br>acid sensing and activation of mTORC1, a signaling complex promoting cell growth in response<br>to growth factors, energy levels, and amino acids. Activated by amino acids through a<br>mechanism involving the lysosomal V-ATPase, the Ragulator functions as a guanine nucleotide<br>exchange factor activating the small GTPases Rag. Activated Ragulator and Rag GTPases<br>function as a scaffold recruiting mTORC1 to lysosomes where it is in turn activated; Belongs<br>to the LAMTOR4 family","Prefoldin subunit 5; Binds specifically to cytosolic chaperonin (c-CPN) and transfers target<br>proteins to it. Binds to nascent polypeptide chain and promotes folding in an environment in<br>which there are many competing pathways for nonnative proteins. Represses the<br>transcriptional activity of MYC; Belongs to the prefoldin subunit alpha family","NADH dehydrogenase [ubiquinone] iron-sulfur protein 6, mitochondrial; Accessory subunit of<br>the mitochondrial membrane respiratory chain NADH dehydrogenase (Complex I), that is<br>believed not to be involved in catalysis. Complex I functions in the transfer of electrons<br>from NADH to the respiratory chain. The immediate electron acceptor for the enzyme is<br>believed to be ubiquinone","Copper transport protein ATOX1; Binds and deliver cytosolic copper to the copper ATPase<br>proteins. May be important in cellular antioxidant defense; Belongs to the ATX1 family","Mitochondrial fission 1 protein; Involved in the fragmentation of the mitochondrial network<br>and its perinuclear clustering. Plays a minor role in the recruitment and association of the<br>fission mediator dynamin- related protein 1 (DNM1L) to the mitochondrial surface and<br>mitochondrial fission. Can induce cytochrome c release from the mitochondrion to the<br>cytosol, ultimately leading to apoptosis. Also mediates peroxisomal fission; Belongs to the<br>FIS1 family","Myosin light polypeptide 6; Regulatory light chain of myosin. Does not bind calcium; EF-hand<br>domain containing","NEDD8; Ubiquitin-like protein which plays an important role in cell cycle control and<br>embryogenesis. Covalent attachment to its substrates requires prior activation by the E1<br>complex UBE1C- APPBP1 and linkage to the E2 enzyme UBE2M. Attachment of NEDD8 to cullins<br>activates their associated E3 ubiquitin ligase activity, and thus promotes<br>polyubiquitination and proteasomal degradation of cyclins and other regulatory proteins","7SK snRNA methylphosphate capping enzyme; S-adenosyl-L-methionine-dependent<br>methyltransferase that adds a methylphosphate cap at the 5'-end of 7SK snRNA, leading to<br>stabilize it","Glutamate-rich WD repeat-containing protein 1; Histone binding-protein that regulates<br>chromatin dynamics and minichromosome maintenance (MCM) loading at replication origins,<br>possibly by promoting chromatin openness; WD repeat domain containing","Interferon regulatory factor ocesses such as vesicle mediated transport [...]","Regulating synaptic membrane exocytosis protein 4; Regulates synaptic membrane exocytosis","Crk-like protein; May mediate the transduction of intracellular signals; SH2 domain<br>containing","ARF GTPase-activating protein GIT1; GTPase-activating protein for the ADP ribosylation<br>factor family. May serve as a scaffold to bring together molecules to form signaling modules<br>controlling vesicle trafficking, adhesion and cytoskeletal organization. Increases the speed<br>of cell migration, as well as the size and rate of formation of protrusions, possibly by<br>targeting PAK1 to adhesions and the leading edge of lamellipodia. Sequesters inactive<br>non-tyrosine- phosphorylated paxillin in cytoplasmic complexes. Involved in the regulation<br>of cytokinesis; the function may involve SDCCAG3 and [...]","Dipeptidyl aminopeptidase-like protein 6; Promotes cell surface expression of the potassium<br>channel KCND2. Modulates the activity and gating characteristics of the potassium channel<br>KCND2. Has no dipeptidyl aminopeptidase activity; DASH family","NT-3 growth factor receptor; Receptor tyrosine kinase involved in nervous system and<br>probably heart development. Upon binding of its ligand NTF3/neurotrophin-3, NTRK3<br>autophosphorylates and activates different signaling pathways, including the<br>phosphatidylinositol 3-kinase/AKT and the MAPK pathways, that control cell survival and<br>differentiation; I-set domain containing","Serine incorporator 5; Restriction factor required to restrict infectivity of lentiviruses,<br>such as HIV-1: acts by inhibiting an early step of viral infection. Impairs the penetration<br>of the viral particle into the cytoplasm. Enhances the incorporation of serine into<br>phosphatidylserine and sphingolipids. May play a role in providing serine molecules for the<br>formation of myelin glycosphingolipids in oligodendrocytes (By similarity)","Kelch repeat and BTB domain containing 11","Protein bfamily. CHRM1 sub-subfamily","Transmembrane protein 151A","Neurensin-2; May play a role in maintenance and/or transport of vesicles","Prolow-density lipoprotein receptor-related protein 1; Endocytic receptor involved in<br>endocytosis and in phagocytosis of apoptotic cells. Required for early embryonic<br>development. Involved in cellular lipid homeostasis. Involved in the plasma clearance of<br>chylomicron remnants and activated LRPAP1 (alpha 2-macroglobulin), as well as the local<br>metabolism of complexes between plasminogen activators and their endogenous inhibitors. May<br>modulate cellular events, such as APP metabolism, kinase-dependent intracellular signaling,<br>neuronal calcium signaling as well as neurotransmission. Acts as [...]","Cathepsin L1; Important for the overall degradation of proteins in lysosomes; Cathepsins","Cofilin-1; Binds to F-actin and exhibits pH-sensitive F-actin depolymerizing activity.<br>Regulates actin cytoskeleton dynamics. Important for normal progress through mitosis and<br>normal cytokinesis. Plays a role in the regulation of cell morphology and cytoskeletal<br>organization. Required for the up-regulation of atypical chemokine receptor ACKR2 from<br>endosomal compartment to cell membrane, increasing its efficiency in chemokine uptake and<br>degradation. Required for neural tube morphogenesis and neural crest cell migration (By<br>similarity)","Coatomer subunit epsilon; The coatomer is a cytosolic protein complex that binds to dilysine<br>motifs and reversibly associates with Golgi non- clathrin-coated vesicles, which further<br>mediate biosynthetic protein transport from the ER, via the Golgi up to the trans Golgi<br>network. The coatomer complex is required for budding from Golgi membranes, and is essential<br>for the retrograde Golgi-to-ER transport of dilysine-tagged proteins. In mammals, the<br>coatomer can only be recruited by membranes associated with ADP- ribosylation factors<br>(ARFs), which are small GTP-binding protei anes different set of downstream effectors directly responsible<br>for vesicle formation, movement, tethering and fusion. Together with SUFU, prevents nuclear<br>import of GLI1, and thereby inhibits GLI1 transcription factor activity. Regulates GLI1 in<br>differentiating chondrocytes. Likewise, regulates GLI3 pr [...]","Cadherin-22; Cadherins are calcium-dependent cell adhesion proteins. They preferentially<br>interact with themselves in a homophilic manner in connecting cells; cadherins may thus<br>contribute to the sorting of heterogeneous cell types. PB-cadherins may have a role in the<br>morphological organization of pituitary gland and brain tissues (By similarity)","Serine/threonine-protein kinase WNK1; Serine/threonine kinase which plays an important role<br>in the regulation of electrolyte homeostasis, cell signaling, survival, and proliferation.<br>Acts as an activator and inhibitor of sodium-coupled chloride cotransporters and<br>potassium-coupled chloride cotransporters respectively. Activates SCNN1A, SCNN1B, SCNN1D and<br>SGK1. Controls sodium and chloride ion transport by inhibiting the activity of WNK4, by<br>either phosphorylating the kinase or via an interaction between WNK4 and the autoinhibitory<br>domain of WNK1. WNK4 regulates the activity of the thia [...]","Protein Wnt-5b; Ligand for members of the frizzled family of seven transmembrane receptors.<br>Probable developmental protein. May be a signaling molecule which affects the development of<br>discrete regions of tissues. Is likely to signal over only few cell diameters (By<br>similarity); Belongs to the Wnt family","Interleukin-17 receptor E; Specific functional receptor for IL17C. May be signaling through<br>the NF-kappa-B and MAPK pathways. May require TRAF3IP2 /ACT1 for signaling. May be a crucial<br>regulator in innate immunity to bacterial pathogens. Isoform 2 and isoform 4 may be either<br>cytoplasmic inactive or dominant active forms. Isoform 3 and isoform 5 may act as soluble<br>decoy quent translocation to the nucleus. Interaction with TNR induces a<br>repulsion of neurons and an inhibition of neurit [...]","Protein kinase C-binding protein NELL2; Required for neuron survival through the modulation<br>of MAPK pathways (By similarity). Involved in the regulation of hypothalamic GNRH secretion<br>and the control of puberty (By similarity)","poly(ADP-ribose) polymerase family member 8","Sister chromatid cohesion protein PDS5 homolog B; Regulator of sister chromatid cohesion in<br>mitosis which may stabilize cohesin complex association with chromatin. May couple sister<br>chromatid cohesion during mitosis to DNA replication. Cohesion ensures that chromosome<br>partitioning is accurate in both meiotic and mitotic cells and plays an important role in<br>DNA repair. Plays a role in androgen-induced proliferative arrest in prostate cells;<br>Armadillo-like helical domain containing","Anoctamin-6; Small-conductance calcium-activated nonselective cation (SCAN) channel which<br>acts as a regulator of phospholipid scrambling in platelets and osteoblasts. Phospholipid<br>scrambling results in surface exposure of phosphatidylserine which in platelets is essential<br>to trigger the clotting system whereas in osteoblasts is essential for the deposition of<br>hydroxyapatite during bone mineralization. Has calcium-dependent phospholipid scramblase<br>activity; scrambles phosphatidylserine, phosphatidylcholine and galactosylceramide (By<br>similarity). Can generate outwardly rectifying chlorid [...]","Dendrin; Promotes apoptosis of kidney glomerular podocytes. Podocytes are highly specialized<br>cells essential to the ultrafiltration of blood, resulting in the extraction of urine and<br>the retention of protein (By similarity)","5'-AMP-activated protein kinase subunit gamma-1; AMP/ATP-binding subunit of AMP-activated<br>protein kinase (AMPK), an energy sensor protein kinase that plays a key role in regulating<br>cellular energy metabolism. In response to reduction ired for<br>maintenance of rapid intracellular calcium release. May act as a potassium counter-ion<br>channel that functions in synchronization with calcium release from intracellular stores","Histamine H2 receptor; The H2 subclass of histamine receptors mediates gastric acid<br>secretion. Also appears to regulate gastrointestinal motility and intestinal secretion.<br>Possible role in regulating cell growth and differentiation. The activity of this receptor<br>is mediated by G proteins which activate adenylyl cyclase and, through a separate G<br>protein-dependent mechanism, the phosphoinositide/protein kinase (PKC) signaling pathway (By<br>similarity); Belongs to the G-protein coupled receptor 1 family","Protein unc-13 homolog A; Plays a role in vesicle maturation during exocytosis as a target<br>of the diacylglycerol second messenger pathway. Involved in neurotransmitter release by<br>acting in synaptic vesicle priming prior to vesicle fusion and participates in the<br>activity-dependent refilling of readily releasable vesicle pool (RRP). Essential for<br>synaptic vesicle maturation in most excitatory/glutamatergic but not<br>inhibitory/GABA-mediated synapses (By similarity). Also involved in secretory granule<br>priming in insulin secretion (By similarity). Interacts with FBXO45 (via SRY domain); lead<br>[...]","Ras-related protein Rab-40B; May be a substrate-recognition component of a SCF-like ECS<br>(Elongin-Cullin-SOCS-box protein) E3 ubiquitin ligase complex which mediates the<br>ubiquitination and subsequent proteasomal degradation of target proteins; Belongs to the<br>small GTPase superfamily. Rab family","Microtubule associated serine/threonine kinase 3; Belongs to the protein kinase superfamily.<br>AGC Ser/Thr protein kinase family","Sodium/calcium exchanger 2; Mediates the electrogenic exchange of Ca(2+) against Na(+) ions<br>across the cell membrane, and thereby contributes to the regulation of cytoplasmic Ca(2+)<br>levels and Ca(2+)-dependent cellular p
